from collections import Counterclass Solution:    def hasGroupsSizeX(self, deck):        """        :type deck: List[int]        :rtype: bool        """        dict=Counter(deck)        nums=sorted(dict.values())        if nums[0]<2:            return False        temp,n=2,len(nums)        while temp<=nums[0]:            index=1            for i in range(n):                if nums[i]%temp!=0:                    index=0                    break            if index:                return True            else:                temp+=1        return Falses=Solution()deck=[1,1]print(s.hasGroupsSizeX(deck))